import React from "react";
import { Routes, Route } from "react-router-dom";
import Homepage from "./Homepage";

const appRoutes = [Homepage];

const RenderRoutes = () => (
  <Routes>
    {appRoutes.map((route: any, i: number) => (
      <Route {...route} key={i} />
    ))}
  </Routes>
);

export default RenderRoutes;
